// const CRABIPIE_ICON_BASE64: &str = "some base64 string here";

#[derive(PartialEq)]
enum RequestTab {
    Body,
    Headers,
    Auth,
}

#[derive(PartialEq, Clone)]
enum ContentType {
    Json,
    FormData,
    FormUrlEncoded,
}

#[derive(Clone, PartialEq)]
enum FormFieldType {
    Text,
    File,
}

#[derive(Clone)]
struct FormField {
    key: String,
    value: String,
    files: Vec<String>,
    field_type: FormFieldType,
}

#[derive(PartialEq, Clone)]
enum AuthType {
    None,
    Bearer,
}

#[derive(PartialEq, Clone)]
enum LayoutMode {
    Horizontal,
    Vertical,
}

#[derive(PartialEq, Clone, Debug)]
enum HttpMethod {
    GET,
    POST,
    PUT,
    DELETE,
    PATCH,
}

#[derive(PartialEq)]
enum ResponseTab {
    None,
    Body,
    Headers,
}

struct HttpResponse {
    status: String,
    headers: String,
    body: String,
    is_binary: bool,
    filename: String,
    bytes: Vec<u8>,
    content_type: String,
}

#[derive(Hash, Eq, PartialEq, Clone)]
struct HighlightCacheKey {
    text: String,
    search_text: String,
    search_pos: Option<usize>,
    case_sensitive: bool,
}

#[derive(PartialEq)]
enum FindContext {
    None,
    RequestBody,
    ResponseBody,
}

struct FindDialog {
    open: bool,
    replace_mode: bool,
    find_text: String,
    replace_text: String,
    case_sensitive: bool,
    whole_word: bool,
    context: FindContext,
    current_match: usize,
    total_matches: usize,
    current_match_pos: Option<usize>,
    scroll_to_match: bool,
    target_scroll_y: Option<f32>,
    line_height: f32,
}

impl Default for FindDialog {
    fn default() -> Self {
        Self {
            open: false,
            replace_mode: false,
            find_text: String::new(),
            replace_text: String::new(),
            case_sensitive: false,
            whole_word: false,
            context: FindContext::None,
            current_match: 0,
            total_matches: 0,
            current_match_pos: None,
            scroll_to_match: false,
            target_scroll_y: None,
            line_height: 14.0,
        }
    }
}

